import React from 'react';
import CartItem from './CartItem';

const Cart = ({ cart }) => {
  return (
    <div>
      <h2>Корзина</h2>
      {cart.map((product) => (
        <CartItem key={product.id} product={product} />
      ))}
    </div>
  );
};

export default Cart;
